import React from 'react'
import { Link, withRouter } from 'react-router-dom';

const Register = () => {



	return (
		<div className="register">
			<p className="register__title">Регистрация</p>
			<form className="form register__form">
				<input className="input register__input" placeholder="Email"></input>
				<input className="input register__input" placeholder="Пароль"></input>
				<button className="button hover-button register__button" type="submit" >Зарегистрироваться</button>
			</form>
			<Link to="login" className="register__login-link">Войти</Link>
			{/* Уже зарегистрированы? Войти */}
		</div>
	)
}


export default Register;
